            __builder.AddMarkupContent(0, "<h1>Welcome to the United Airlines Association</h1>\r\n<br>\r\n");
            __builder.AddMarkupContent(1, "<h2 id=\"sep6-project-formulation\"><strong>SEP6 Project Formulation</strong></h2>\r\n");
            __builder.AddMarkupContent(2, @"<p>
    <strong>Deadline for hand-in:</strong>
    June 4th, 2020 at 13:00 (hand in on Wiseflow)
    <br>
    <strong>Groups:</strong>
    You must be using your BPR1 groups for this project (if this is not possible, you must form a
    group of 2-4 students).
    <br>
    <strong>Evaluation:</strong>
    The project is assessed solely on
    the written project which is assessed as either approved/not-approved. The evaluation is part
    of the overall evaluation of SEP6. Please see the course description for information about the
    other parts.
</p>

");
            __builder.AddMarkupContent(3, "<h2 id=\"purpose\"><strong>Purpose</strong></h2>\r\n");
            __builder.AddMarkupContent(4, "<p>\r\n    The purpose is to examine the concept of Cloud Computing and the strategic considerations for\r\n    using Cloud Computing.\r\n</p>\r\n\r\n");
            __builder.AddMarkupContent(5, "<h2 id=\"about-the-project\"><strong>About the project</strong></h2>\r\n");
            __builder.AddMarkupContent(6, @"<p>
    The United Airplanes Association has hired you to create an application for them. The application
    will be used exclusively by a select few managers within the company. The managers need
    airport-related data readily available on their tablets, displayed through a web browser. The
    company is not interested in hosting the applications on their own premises. High uptime is essential,
    and the application must be available from anywhere with an internet connection and a web browser.
</p>
");
            __builder.AddMarkupContent(7, @"<p>
    Due to the above requirements, you will need to set up a cloud infrastructure. You decide what
    technology to use. That is, what cloud provider (Google, Microsoft, AWS, etc.) to utilize and what
    languages (Python, JavaScript, C#, Java, etc.) and frameworks to construct your web application in.
</p>
");
            __builder.AddMarkupContent(8, @"<p>
    The requirements of the SEP6 project are predefined. The main bulk of the work lies in you researching
    how to go about fulfilling the requirements, and subsequently implementing and writing about how you
    went about it. The datasets are made available to you as .csv files. The datasets consist of the
    ny​cflights13 data which contains the ​airlines​, ​airports​, ​flights​, ​planes​, and ​weather​ datasets. Please
    see the documentation (​nycflights13.pdf​) for further information.
</p>

");
            __builder.AddMarkupContent(9, "<h2 id=\"functional-requirements\"><strong>Functional requirements</strong></h2>\r\n");
            __builder.AddMarkupContent(10, "<p>\r\n    In what follows, “origin” refers to only JFK, EWR, and LGA. Apart from being able to load the \r\n    flight data from the cloud, your system must be able to display/visualize:\r\n</p>\r\n");
            __builder.AddMarkupContent(11, "<ol style=\"list-style-type: decimal\">\r\n    <li><a href=\"totalflights\">Total number of flights per month</a></li>\r\n    <li>\r\n        <a href=\"totalflights\">\r\n            Total number of flights per month from the three origins in one plot. We want to be able to see:\r\n        </a>\r\n        <ul>\r\n            <li>Frequency</li>\r\n            <li>Frequency stacked</li>\r\n            <li>Stacked percentage</li>\r\n        </ul>\r\n    </li>\r\n    <li>\r\n        <a href=\"topDestinations\">\r\n            The top-10 destinations and how many flights were made to these\r\n        </a>\r\n            <ul>\r\n                <li>For these 10 destinations, make a visualization of the number of flights from the three origins to the top-10 destination.</li>\r\n                <li>The mean airtime of each of the origins in a table</li>\r\n            </ul>\r\n    </li>\r\n    <li><a href=\"temperatures\">How many weather observations there are for the origins in a table</a></li>\r\n    <li><a href=\"temperatures\">For each of the three origins, all temperature attributes in degree Celsius (i.e. you need to convert from Fahrenheit to Celsius)</a></li>\r\n    <li><a href=\"temperatures\">The temperature (in Celsius) at JFK.</a></li>\r\n    <li><a href=\"temperatures\">The daily mean temperature (in Celsius) at JFK</a></li>\r\n    <li><a href=\"temperatures\">The daily mean temperature (in Celsius) for each origin in the same plot</a></li>\r\n    <li><a href=\"totalflights\">Mean departure and arrival delay for each origin in a table</a></li>\r\n    <li><a href=\"planes\">The manufacturers that have more than 200 planes</a></li>\r\n    <li><a href=\"planes\">The number of flights each manufacturer with more than 200 planes are responsible for</a></li>\r\n    <li><a href=\"planes\">The number of planes of each Airbus Model</a></li>\r\n</ol>\r\n");
            __builder.AddMarkupContent(12, "<p>In the attached “examples”, you can see suggestions of how some of the above requirements can be solved.</p>\r\n");
            __builder.AddMarkupContent(13, "<h2 id=\"documentation\"><strong>Documentation</strong></h2>\r\n");
            __builder.AddMarkupContent(14, "<p>For this project you will only produce one report (i.e. there is no process report). The report must be 10-15 normal pages (2400 characters per page). Each figure/image/table counts as 600 characters.</p>\r\n");
            __builder.AddMarkupContent(15, @"<p>Besides the normal project report requirements, your report must include sections documenting how you manage and work with the DevOps tools of your choice. This includes explaining how you have set up your cloud provider, project management, version control, testing, etc., and if you have automated parts of your workflow through CI/CD.</p>
");
            __builder.AddMarkupContent(16, "<p>Your project report hand-in must contain a link to your working application, hosted by your cloud provider.</p>\r\n<br>\r\n");
